            {/*    /!*<Route path="/admin" element={<Admin/>}/>*!/*/}
            {/*    <Route path="/admin" element={<Admin/>}></Route>*/}
            {/*    <Route path="/admin/product" element={<AdminProduct/>}></Route>*/}
            {/*    <Route path="/admin/order" element={<AdminOrder/>}></Route>*/}
            {/*</Routes>*/}
        </>
    );
}

export default App;
